import './Register.css';
import axios from 'axios'

function Register(){
    const handleSubmit=()=>{
        axios.get("http://localhost:3001/user/test").then((res)=>{
                console.log(res.data);
        }).catch((err)=>{
                console.log(err);
        });

    }
    return(
        <>
         {/* About Start */}
    <div class="container py-5">
        <div class="row py-">
            <div class="col-lg-14 pb-5 pb-lg-0 px-3 px-lg-5">
                <h4 class="text-secondary mb-3">Register Here, </h4>
                <h1 class="display-4 mb-4"><span class="text-primary">Pawn</span> & <span class="text-secondary">Store</span></h1>
              <font color="orange"></font>
                <form action="/action_page.php">
                <div class="form-group">
    <label for="name">Name:</label>
    <input type="text" class="form-control" />
  </div>
  <div class="form-group">
    <label for="email">Email address:</label>
    <input type="email" class="form-control" />
  </div>
  <br/>
  <div class="form-group">
    <label for="pwd">Password:</label>
    <input type="password" class="form-control" />
  </div>
  <br/>

  <button type="button" class="btn btn-success">Submit</button>
</form>

            </div>

        </div>
    </div>
    {/* About End */}
        </>
    );
}
export default Register;
